import image from "../image"
import {useState} from 'react'

function SingIn() {


    const css = {
        body : {
            width: '400px',
            height: '550px',
            backgroundColor: '#0d1a2c',
            margin: 'auto',
            marginTop: '50px',
            marginBottom: '100px',
            paddingLeft: '50px',
            paddingRight: '50px',
            display: 'flex',
            flexDirection: 'column',
            color: 'white',
            fontSize: '22px'
        },
        h1 : {
            marginTop: '30px',
        },
        text : {
            marginTop: '30px',
        },
        input : {
            width: '300px',
            border: '0',
            padding: '0',
            height: '30px'
        }

    }

    return (
        <div style={css.body}>
            <h1 style={css.h1}>Sign In</h1>
            <text style={css.text}>E-mail</text>
            <input type="text" style={css.input}/>
            <text style={css.text}>Password</text>
            <input type="text" style={css.input}/>
        </div>
    )
}
export default SingIn
